import './style.css';
import Navbar from './Navbar';
import Header from './Header';
import Cards from './Cards';
import Search from './Search';
import { BrowserRouter as Router, Route, Switch} from 'react-router-dom';

function App() {
  return (
    <>
    <Router></Router>
    <div className="App">
      <Navbar />
      <Header />
      <div className='pageContainer'>

      </div>
      <Search />
      <Cards />
    </div>
    </>
  );
}

export default App;
